ISLAMABAD, Dec 09 (APP): Kashmir Committee Chairman Shehryar Khan Afridi Wednesday urged the world parliamentarians to play active role in highlighting Kashmir issue at the global fora.
In a tweet, Afridi called for immediate lifting of communication blackout, release of political prisoners and end to state terrorism in Indian Illegally Occupied Jammu & Kashmir.
